INSERT INTO `pencapaian` (`id_pencapaian`, `gambar_pencapaian`, `judul_pencapaian`, `text_pencapaian`) VALUES
(2, , 'Kunjungan Kementerian Pariwisata dan Ekonomi Kreatif', 'Ekonomi Kreatif Indonesia Keripik pisang Noel adalah salah satu oleh-oleh khas dari Toba , khususnya daerah Balige. Makanan ini terbuat dari pisang yang diiris tipis-tipis kemudian digoreng hingga kering dan renyah. Dengan varian rasa yang beragam keripik pisang Noel memiliki cita rasa yang unik dan menggugah selera.Tidak hanya itu, keripik pisang Noel juga telah dicicipi oleh Kementerian Pariwisata dan Ekonomi Kreatif Indonesia bersama dengan Bapak Ir. Poltak Sitorus sebagai Bupati Toba. Hal ini menjadikan Keripik pisang Noel sebagai produk kuliner yang sangat potensial dalam meningkatkan pariwisata Indonesia. Dengan keunikan rasa dan pengakuan dari pihak terkait, para pelaku usaha dapat terus mengembangkan keripik pisang Noel menjadi produk yang semakin menarik bagi konsumen. Selain itu, pengembangan produk ini juga dapat menjadi peluang bisnis yang menjanjikan bagi masyarakat sekitar yang ingin mencoba berwirausaha.');
INSERT INTO `pencapaian` (`id_pencapaian`, `gambar_pencapaian`, `judul_pencapaian`, `text_pencapaian`) VALUES
(3, , 'Mengikuti Pelatihan Hak Kekayaan Intelektual (HKI)', 'Hak Kekayaan Intelektual (HKI) adalah kesempatan yang sangat berharga bagi setiap perusahaan atau individu yang ingin melindungi hak-hak kekayaan intelektual mereka. Dalam pelatihan ini, Meinoel keripik pisang mempelajari berbagai jenis HKI seperti hak paten, hak merek, dan hak cipta, serta bagaimana cara mengajukan permohonan dan memperoleh perlindungan HKI. Dengan memahami HKI dengan baik, Meinoel keripik pisang dapat memastikan bahwa hak-hak kekayaan intelektual mereka dilindungi secara hukum dan tidak akan disalahgunakan oleh pihak lain.');
INSERT INTO `pencapaian` (`id_pencapaian`, `gambar_pencapaian`, `judul_pencapaian`, `text_pencapaian`) VALUES
(4, , 'Menjalin Hubungan Kerjasama dengan Perusahaan Ternama', 'Meinoel keripik pisang hadir di tengah-tengah masyarakat dengan tekad yang kuat untuk memberikan yang terbaik bagi para konsumennya. Selain menjual keripik pisang biasa,Meinoel keripik pisang juga menjalin kerjasama dengan beberapa organisasi dan perusahaan ternama, seperti Hoten Grand Mercure Medan. Kini, pengunjung hotel tersebut bisa menikmati keripik pisang premium dari Meinoel keripik pisang yang disajikan dengan kualitas terbaik. Tidak hanya itu, Meinoel keripik pisang juga berkomitmen untuk terus mengembangkan produknya agar semakin memuaskan para pelanggannya. Dengan begitu, tak heran jika Meinoel keripik pisang semakin dikenal sebagai salah satu produsen keripik pisang terbaik di Indonesia.');

